const CheckBoxes = ({ data, checked, setChecked, opened, setOpened }) => {
  const handleChange = (isChecked, node) => {
    setChecked((prev) => {
      const newState = { ...prev, [node.Id]: isChecked }; // if parent checked then all child elements are checked

      const updateChildren = (node) => {
        node.ChildData?.forEach((child) => {
          newState[child.Id] = isChecked;
          child.ChildData && updateChildren(child);
        });
      };
      updateChildren(node);

      // if children are checked then parents also be checked
      const verifiedChecked = (node) => {
        console.log(node.Name);
        if (!node.IsChildren) return newState[node.Id] || false;
        const allNodeChecked = node.ChildData.every((child) =>
          verifiedChecked(child)
        );
        newState[node.Id] = allNodeChecked;
        return allNodeChecked;
      };

      treedata.forEach((node) => verifiedChecked(node));
      return newState;
    });
    console.log(checked);
  };

  const handleToggle = (node) => {
    setOpened((prev) => ({ ...prev, [node.Id]: !prev[node.Id] }));
  };

  useEffect(() => {
    const updateIndeterminateState = (node) => {
      if (node.IsChildren) {
        const childStates = node.ChildData.map((child) => checked[child.Id]);
        const allChecked = childStates.every((state) => state === true);
        // const noneChecked = childStates.every((state) => state === false);
        const someChecked = childStates.some((state) => state === true);

        const checkbox = document.getElementById(`checkbox-${node.Id}`);
        if (checkbox) {
          checkbox.indeterminate = someChecked && !allChecked;
        }

        node.ChildData.forEach((child) => updateIndeterminateState(child));
      }
    };

    treedata.forEach((node) => updateIndeterminateState(node));
  }, [checked]);

  return (
    <div>
      {data.map((node) => (
        <div key={node.Id} className="ml-4">
          <div className="flex gap-2 items-center">
            {node.IsChildren && (
              <span
                onClick={() => handleToggle(node)}
                className="text-xs cursor-pointer"
              >
                {opened[node.Id] ? <BsDashSquare /> : <BsPlusSquare />}
              </span>
            )}

            <input
              id={`checkbox-${node.Id}`}
              type="checkbox"
              className="mt-0.5 text-xs"
              checked={checked[node.Id] || false}
              onChange={(e) => handleChange(e.target.checked, node)}
            />
            <span>{node.Name}</span>
          </div>
          {node.IsChildren && opened[node.Id] && (
            <div className="ml-4">
              <CheckBoxes
                data={node.ChildData}
                checked={checked}
                setChecked={setChecked}
                opened={opened}
                setOpened={setOpened}
              />
            </div>
          )}
        </div>
      ))}
    </div>
  );
};

export default function App() {
  const [checked, setChecked] = useState({});
  const [opened, setOpened] = useState({});

  return (
    <div>
      <CheckBoxes
        data={treedata}
        checked={checked}
        setChecked={setChecked}
        opened={opened}
        setOpened={setOpened}
      />
    </div>
  );
}
